import React from 'react';
import ReactDOM from 'react-dom/client';
import "./styles.css"
function Cart({isOpen,closecart}){
    return(
    <div className={`cart ${isOpen ? 'open' : ''}`}>
        <p>no products in the cart</p>
        <button onClick={closecart}>close button</button>
    </div>
    )
}
export default Cart;
